import React from 'react';
import { Box, Input } from '@mui/material';
import { useForm } from "react-hook-form";
const Login = () => {

    const onSubmit = (data) => {
        console.log(data)
    }

    return (
        <Box className="LoginForm">
            <Box className="Form1">
                <form onSubmit={handleSubmit(onSubmit)}>
                    <Input>
                    </Input>
               </form>
            </Box>
            <Box className="Form1">

            </Box>
        </Box>
    )
};

export default Login;
